import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        { 
          name: 'Frankenstien',
          id: 'any1' //Unique id for every element
        },
        { 
          name: 'Dracula',
          id: 'any2'
        },
        { 
          name: 'Zombie',
          id: 'any3'
        }
      ]
    }
  }
  render() {
    return (
      <div className="App">
        {this.state.monsters}
    </div>
    );
  }
}

export default App;
